import React, {useEffect} from 'react'

export default function Instagram() {
    const instaFields = 'id,media_type,media_url,thumbnail_url';
    const imgAmount = 3;
    const instaID = '17841424890644350';
    const accessToken = 'IGQVJVRXFJQllyUzFKVkJYdFFiVWxuUXNfY05VeWtzeThUeU5qaFVmODFFMndrenNjU2NTdkI4TEFVS2UxQVJOTTRxN1pPcVNXeVRYRHRUMDVzakxlQ01VTlNFMVRVWE1WZAk9aVmRfVFlEOFppNmc5QlR1ZAEpVdjhsMVBF';
    const instaEndpoint = `https://graph.facebook.com/${instaID}/media?fields=${instaFields}&limit=${imgAmount}&access_token=${accessToken}`;

    const getInstaFeed = () => {
        fetch(instaEndpoint).then(res => res.json())
    }
    useEffect(() => {
        console.log(getInstaFeed())
    }, [])




    return (
        <div className='instagramContainer'>
            <p>{instaEndpoint}</p>
        </div>
    )
}
